  rangeSlider: {
    init: function init() {
      $('.range-slider').each(function (index, element) {
        var dataParams = $(element).data(); // const name = $(element).attr('data-field-name');

        var minName = $(element).attr('data-field-min-name');
        var maxName = $(element).attr('data-field-max-name');
        var type = $(element).attr('data-type');
        var slider = noUiSlider.create(element, {
          start: [dataParams.from, dataParams.to],
          connect: true,
          step: 1,
          range: {
            'min': dataParams.min,
            'max': dataParams.max
          }
        });
        if (type == 'single') $(element).find('.noUi-origin').first().attr('disabled', true); // настраиваем лэйблы для слайдера

        var sliderLabels = $(element).siblings('.range-slider-labels');

        if (sliderLabels.length) {
          var labelFrom = sliderLabels.find('.range-slider-labels_from');
          var labelTo = sliderLabels.find('.range-slider-labels_to');
          slider.on('update', function (values) {
            labelFrom.html(Number(values[0]));
            labelTo.html(Number(values[1]));
          });
        }

        ;
        slider.on('set', function (values, handle) {
          if (handle == 0) $(this.target).siblings('input[name="' + minName + '"]').trigger('change');else $(this.target).siblings('input[name="' + maxName + '"]').trigger('change');
        });
        slider.on('update', function (values) {
          $(this.target).siblings('input[name="' + minName + '"]').val(values[0]);
          $(this.target).siblings('input[name="' + maxName + '"]').val(values[1]);
        });
      });
    }
  },

